import React, { useState, useEffect } from 'react';
import './App.css';
import { Bar, Line, Pie, Doughnut } from 'react-chartjs-2';
import Papa from 'papaparse';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [currentSection, setCurrentSection] = useState('dashboard');
  const [chartData, setChartData] = useState({
    vehicleData: null,
    energyData: null,
    stationData: null,
    usageData: null
  });
  const [isLoading, setIsLoading] = useState(true);
  const [dashboardMetrics, setDashboardMetrics] = useState({
    totalVehicleCount: 0,
    avgRange: 0,
    uniqueMakesCount: 0,
    bevCount: 0,
    phevCount: 0
  });

  useEffect(() => {
    // Load and parse the CSV file
    const loadCSVData = async () => {
      try {
        const response = await fetch('/data-to-visualize/Electric_Vehicle_Population_Data.csv');
        const csvData = await response.text();
        
        Papa.parse(csvData, {
          header: true,
          complete: (results) => {
            const data = results.data.filter(row => Object.keys(row).length > 1); // Filter out empty rows
            processData(data);
          },
          error: (error) => {
            console.error('Error parsing CSV:', error);
            setIsLoading(false);
          }
        });
      } catch (error) {
        console.error('Error fetching CSV:', error);
        setIsLoading(false);
      }
    };
    
    const processData = (data) => {
      // Process vehicle registration by year
      const vehiclesByYear = {};
      data.forEach(row => {
        const year = row['Model Year'];
        if (year && !isNaN(year)) {
          vehiclesByYear[year] = (vehiclesByYear[year] || 0) + 1;
        }
      });
      
      // Sort years and get counts
      const sortedYears = Object.keys(vehiclesByYear).sort();
      const vehicleCounts = sortedYears.map(year => vehiclesByYear[year]);
      
      // Process energy consumption (using Electric Range as proxy)
      const energyByYear = {};
      let totalVehicles = 0;
      data.forEach(row => {
        const year = row['Model Year'];
        const range = parseFloat(row['Electric Range']);
        if (year && !isNaN(year) && !isNaN(range)) {
          if (!energyByYear[year]) {
            energyByYear[year] = { total: 0, count: 0 };
          }
          energyByYear[year].total += range;
          energyByYear[year].count += 1;
          totalVehicles += 1;
        }
      });
      
      // Calculate average energy consumption by year
      const avgEnergyByYear = {};
      Object.keys(energyByYear).forEach(year => {
        avgEnergyByYear[year] = energyByYear[year].total / energyByYear[year].count;
      });
      
      const sortedEnergyYears = Object.keys(avgEnergyByYear).sort();
      const avgEnergyCounts = sortedEnergyYears.map(year => avgEnergyByYear[year]);
      
      // Process charging station distribution by county
      const stationsByCounty = {};
      data.forEach(row => {
        const county = row['County'];
        if (county) {
          stationsByCounty[county] = (stationsByCounty[county] || 0) + 1;
        }
      });
      
      // Get top 5 counties
      const topCounties = Object.keys(stationsByCounty)
        .sort((a, b) => stationsByCounty[b] - stationsByCounty[a])
        .slice(0, 5);
      
      const countyData = topCounties.map(county => stationsByCounty[county]);
      
      // Process usage by vehicle type
      const usageByType = {};
      data.forEach(row => {
        const type = row['Electric Vehicle Type'];
        if (type) {
          usageByType[type] = (usageByType[type] || 0) + 1;
        }
      });
      
      const vehicleTypes = Object.keys(usageByType);
      const typeCounts = vehicleTypes.map(type => usageByType[type]);
      
      // Calculate metrics for dashboard cards
      const totalVehicleCount = data.length;
      
      // Calculate average electric range
      let totalRange = 0;
      let rangeCount = 0;
      data.forEach(row => {
        const range = parseFloat(row['Electric Range']);
        if (!isNaN(range) && range > 0) {
          totalRange += range;
          rangeCount++;
        }
      });
      const avgRange = rangeCount > 0 ? Math.round(totalRange / rangeCount) : 0;
      
      // Count unique makes
      const uniqueMakes = new Set();
      data.forEach(row => {
        if (row['Make']) {
          uniqueMakes.add(row['Make']);
        }
      });
      
      // Count BEVs vs PHEVs
      let bevCount = 0;
      let phevCount = 0;
      data.forEach(row => {
        if (row['Electric Vehicle Type'] && row['Electric Vehicle Type'].includes('BEV')) {
          bevCount++;
        } else if (row['Electric Vehicle Type'] && row['Electric Vehicle Type'].includes('PHEV')) {
          phevCount++;
        }
      });
      
      // Set dashboard metrics
      setDashboardMetrics({
        totalVehicleCount,
        avgRange,
        uniqueMakesCount: uniqueMakes.size,
        bevCount,
        phevCount
      });
      
      // Set chart data
      setChartData({
        vehicleData: {
          labels: sortedYears,
          datasets: [{
            label: 'Total Vehicles',
            data: vehicleCounts,
            backgroundColor: 'rgba(54, 162, 235, 0.5)',
            borderColor: 'rgb(54, 162, 235)',
            borderWidth: 1
          }]
        },
        energyData: {
          labels: sortedEnergyYears,
          datasets: [{
            label: 'Average Electric Range (miles)',
            data: avgEnergyCounts,
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgb(255, 99, 132)',
            borderWidth: 2,
            tension: 0.3,
            fill: true
          }]
        },
        stationData: {
          labels: topCounties,
          datasets: [{
            label: 'Vehicle Distribution by County',
            data: countyData,
            backgroundColor: [
              'rgba(255, 99, 132, 0.6)',
              'rgba(54, 162, 235, 0.6)',
              'rgba(255, 206, 86, 0.6)',
              'rgba(75, 192, 192, 0.6)',
              'rgba(153, 102, 255, 0.6)',
            ],
            borderColor: [
              'rgb(255, 99, 132)',
              'rgb(54, 162, 235)',
              'rgb(255, 206, 86)',
              'rgb(75, 192, 192)',
              'rgb(153, 102, 255)',
            ],
            borderWidth: 1
          }]
        },
        usageData: {
          labels: vehicleTypes,
          datasets: [{
            label: 'Vehicles by Type',
            data: typeCounts,
            backgroundColor: 'rgba(75, 192, 192, 0.5)',
            borderColor: 'rgb(75, 192, 192)',
            borderWidth: 1
          }]
        }
      });
      
      setIsLoading(false);
    };
    
    loadCSVData();
  }, []);

  const barOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicle Registration by Year',
      },
    },
  };

  const lineOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Average Electric Range by Year',
      },
    },
  };
  
  const pieOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'right',
      },
      title: {
        display: true,
        text: 'Vehicle Distribution by County',
      },
    },
  };

  const hourlyOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicles by Type',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'Count'
        }
      },
      x: {
        title: {
          display: true,
          text: 'Vehicle Type'
        }
      }
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-brand">
          <h1>EV Analytics Dashboard</h1>
        </div>
        

      </nav>
      
      <main className="content">
        <section id="dashboard" className="dashboard-container">
          <h2>EV Analytics Overview</h2>
          
          {isLoading ? (
            <div className="loading-spinner">Loading data...</div>
          ) : (
            <>
              <div className="dashboard-grid single-row">
                <div className="dashboard-card">
                  <h3>Total Vehicles</h3>
                  <p className="metric">{dashboardMetrics.totalVehicleCount.toLocaleString()}</p>
                  <p className="trend positive">From {dashboardMetrics.totalVehicleCount} records</p>
                </div>
                <div className="dashboard-card">
                  <h3>Average Electric Range</h3>
                  <p className="metric">{dashboardMetrics.avgRange} miles</p>
                  <p className="trend neutral">Based on available data</p>
                </div>
                <div className="dashboard-card">
                  <h3>Unique Manufacturers</h3>
                  <p className="metric">{dashboardMetrics.uniqueMakesCount}</p>
                  <p className="trend positive">Different EV makers</p>
                </div>
                <div className="dashboard-card">
                  <h3>BEV vs PHEV Ratio</h3>
                  <p className="metric">
                    {Math.round((dashboardMetrics.bevCount / (dashboardMetrics.bevCount + dashboardMetrics.phevCount)) * 100)}%
                  </p>
                  <p className="trend neutral">{dashboardMetrics.bevCount} BEVs, {dashboardMetrics.phevCount} PHEVs</p>
                </div>
              </div>
              
              <div className="data-table-container">
                <h3>Key EV Metrics Table</h3>
                <div className="data-table-wrapper">
                  <table className="data-table">
                    <thead>
                      <tr>
                        <th>Metric</th>
                        <th>Value</th>
                        <th>Trend/Notes</th>
                      </tr>
                    </thead>
                    <tbody>
                      <tr>
                        <td>Total EV Population</td>
                        <td>{dashboardMetrics.totalVehicleCount.toLocaleString()}</td>
                        <td>Complete dataset records</td>
                      </tr>
                      <tr>
                        <td>Battery Electric Vehicles (BEVs)</td>
                        <td>{dashboardMetrics.bevCount.toLocaleString()}</td>
                        <td>{Math.round((dashboardMetrics.bevCount / dashboardMetrics.totalVehicleCount) * 100)}% of total</td>
                      </tr>
                      <tr>
                        <td>Plug-in Hybrid Vehicles (PHEVs)</td>
                        <td>{dashboardMetrics.phevCount.toLocaleString()}</td>
                        <td>{Math.round((dashboardMetrics.phevCount / dashboardMetrics.totalVehicleCount) * 100)}% of total</td>
                      </tr>
                      <tr>
                        <td>Average Electric Range</td>
                        <td>{dashboardMetrics.avgRange} miles</td>
                        <td>Across all vehicle types</td>
                      </tr>
                      <tr>
                        <td>Unique Manufacturers</td>
                        <td>{dashboardMetrics.uniqueMakesCount}</td>
                        <td>Diverse market participation</td>
                      </tr>
                      <tr>
                        <td>Top County</td>
                        <td>{chartData.stationData?.labels[0] || 'N/A'}</td>
                        <td>{chartData.stationData?.datasets[0]?.data[0]?.toLocaleString() || 0} vehicles</td>
                      </tr>
                      <tr>
                        <td>Second County</td>
                        <td>{chartData.stationData?.labels[1] || 'N/A'}</td>
                        <td>{chartData.stationData?.datasets[0]?.data[1]?.toLocaleString() || 0} vehicles</td>
                      </tr>
                      <tr>
                        <td>BEV to PHEV Ratio</td>
                        <td>{(dashboardMetrics.bevCount / dashboardMetrics.phevCount).toFixed(2)}</td>
                        <td>BEVs per PHEV</td>
                      </tr>
                    </tbody>
                  </table>
                </div>
              </div>
              
              <div className="charts-container">
                <div className="chart-row">
                  <div className="chart-wrapper half-width">
                    <Bar data={chartData.vehicleData} options={barOptions} />
                    <p className="chart-description">Vehicle registrations by model year show the growth trend of electric vehicles over time, with newer models becoming increasingly popular.</p>
                  </div>
                  <div className="chart-wrapper half-width">
                    <Line data={chartData.energyData} options={lineOptions} />
                    <p className="chart-description">Average electric range has been steadily increasing over the years, demonstrating improvements in battery technology and addressing range anxiety concerns.</p>
                  </div>
                </div>
                <div className="chart-row">
                  <div className="chart-wrapper small-chart pie-chart-container">
                    <Pie data={chartData.stationData} options={{...pieOptions, maintainAspectRatio: true}} />
                    <p className="chart-description">The distribution of electric vehicles across counties shows concentration in urban areas, reflecting charging infrastructure availability and adoption patterns.</p>
                  </div>
                  <div className="chart-wrapper small-chart doughnut-chart-container">
                    <Doughnut data={chartData.stationData} options={{...pieOptions, maintainAspectRatio: true}} />
                    <p className="chart-description">County distribution highlights potential areas for infrastructure expansion to support growing EV adoption in less represented regions.</p>
                  </div>
                </div>
                <div className="chart-wrapper medium-width-chart">
                  <Bar data={chartData.usageData} options={hourlyOptions} />
                  <p className="chart-description">The breakdown by vehicle type shows the market share between battery electric vehicles (BEVs) and plug-in hybrid electric vehicles (PHEVs), indicating consumer preferences.</p>
                </div>
              </div>
            </>
          )}
        </section>
      </main>
      
      <footer className="footer">
        <div className="footer-content">
          <p>© 2025 EV Analytics Dashboard. All rights reserved.</p>
          <div className="footer-links">
            <a href="#privacy">Privacy Policy</a>
            <a href="#terms">Terms of Service</a>
            <a href="#contact">Contact</a>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
